import React from 'react';
import homeImage from "./../../images/homes.jfif";
import "./LatestArticlesCards.css";

function LatestArticlesCards() {
    return (
        <div className="latest-card">
            <img src={homeImage} alt="" />
            <h2>Joshua Tree Overnight Adventure</h2>
            <p>Gujarat is vastly underrated and it's a mystery to us why the region isn't more well-known as a tourist destination, it has a plethora of temples and places</p>
            <div>
                <p style={{ "fontWeight": "900", "display": "inline" }}>Travel</p>
                <p style={{"fontWeight":"100", "display":"inline"}}>/ August 21 2017</p>
            </div>
        </div>
    )
}

export default LatestArticlesCards;
